import React from 'react';
import './Hobbies.css';

const Hobbies = () => {
  return (
    <section id="hobbies" className="hobbies">
      <h2>Hobbies</h2>
      <ul>
        <li>Reading Books</li>
        <li>Playing Sports</li>
        <li>Traveling</li>
        <li>Coding</li>
      </ul>
    </section>
  );
};

export default Hobbies;
